import { NavLink } from 'react-router-dom';

function NavBar() {
  return (
    <nav className="bg-white shadow-lg py-4 px-6 fixed w-full top-0 z-10">
      <div className="max-w-7xl mx-auto flex justify-between items-center">
        <h1 className="text-xl font-bold text-gray-800">ScamSafe</h1>
        <div className="space-x-6">
          <NavLink to="/" className={({ isActive }) => (isActive ? 'text-blue-600 font-semibold' : 'text-gray-600 hover:text-blue-500')}>Home</NavLink>
          <NavLink to="/help-advice" className={({ isActive }) => (isActive ? 'text-blue-600 font-semibold' : 'text-gray-600 hover:text-blue-500')}>Help & Advice</NavLink>
          <NavLink to="/scam-trends" className={({ isActive }) => (isActive ? 'text-blue-600 font-semibold' : 'text-gray-600 hover:text-blue-500')}>Scam Trends</NavLink>
          <NavLink to="/fraud-contact" className={({ isActive }) => (isActive ? 'text-blue-600 font-semibold' : 'text-gray-600 hover:text-blue-500')}>Fraud Contacts</NavLink>
        </div>
      </div>
    </nav>
  );
}

export default NavBar;
